(self.webpackChunkanomaly_new=self.webpackChunkanomaly_new||[]).push([[306],{306:function(e,a,o){"use strict";o.r(a);var s=o(857),r=o(9487),n=o.n(r);a.default=(0,s.$2)(n())},9487:function(e){e.exports={charset:"utf-8",headers:{"Plural-Forms":"nplurals=2; plural=(n != 1);"},translations:{"":{"1000 + veteran care specialists (psychological, medical, social services)":{msgstr:["1000+ especialistas en cuidados para Veteranos ( Psicologos, Medicos, Servicios Sociales)"]},"20,000+ members of underserved communities taught, including Ukrainian veterans and their children, IDPs, and Crimean Tatars. For children and teens, Anomaly provides and conversation clubs and civic engagement opportunities in addition to lessons. Through socially-engaged volunteering, young people learn that they can have a real impact on their neighbourhoods, cities, and country. ( add more general info); Link to English NOW (more detailed info on this page).":{msgstr:["Más de 20.000 miembros de comunidades marginadas, incluyendo veteranos ucranianos y sus hijos, desplazados internos y Tatares Crimeos. Para niños y adolescentes, Anomaly ofrece oportunidades de conversación y participación cívica además de las lecciones. A través del voluntariado socialmente comprometido, los jóvenes aprenden que pueden tener un impacto real en sus barrios, ciudades y países. ( add more general info); Link to Spanish NOW (more detailed info on this page)."]},"3500 + veterans in our community":{msgstr:["3500 + veteranos en nuestra comunidad"]},About:{msgstr:["Acerca de"]},"About Us":{msgstr:["Acerca de nosotros"]},Address:{msgstr:["Dirección"]},Animals:{msgstr:["Animales"]},"Anomaly connects foreign donors with an orphanage in Mariupol to help children find a new family and home.":{msgstr:["Anomaly conecta a donantes extranjeros con un orfanato en Mariupol para ayudar a los niños a encontrar una nueva familia y hogar."]},"Anomaly has helped to organize 40 waste clean ups in neighborhoods all around Kyiv and 15 more around Ukraine. If you would like to host a local clean up- Anomaly can show you how!":{msgstr:["Anomaly ha ayudado a organizar 40 limpiezas de residuos en los alrededores de Kiev y 15 más alrededor de Ucrania. Si quieres organizar una limpieza local - ¡Anomaly puede mostrarte cómo!"]},"Anomaly helps adovcate the rights of children and promote better living quality for vulnerable children.":{msgstr:["Anomaly ayuda a abogar los derechos de los niños y a promover una mejor calidad de vida para los niños vulnerables."]},"Anomaly helps the Ukrainian environment with neigborhood clean-ups and environmental advocacy projects. Anomaly hosts up to 3 cleans-ups a month to help minimize public litter. By doing so, Anomaly helps its participants learn about the effects of waste on the environment (both local and worldwide) and learn how to create similar projects at home. To add on, Anomaly helps to lobby environmental issues occuring in multiple cities across Ukraine. We will pinpoint any companies that are at the core of enironvmental issues and combat them through advocacy and lobbying.":{msgstr:["Anomaly ayuda al medio ambiente ucraniano con proyectos de limpieza y defensa del medio ambiente. Al hacerlo, Anomaly ayuda a sus participantes a aprender sobre los efectos de los residuos en el medio ambiente (tanto locales como mundiales) y a aprender a crear proyectos similares en casa. Para añadir, Anomaly ayuda a sacar a relucir los problemas ambientales que ocurren en múltiples ciudades de Ucrania. Señalaremos cualquier empresa que esté en el centro de las cuestiones enironvmentales y las combatiremos a través de la promoción y el activismo."]},"Anomaly offers free english lessons and workshops on various topics. We offer these lessons to any adult in need to help promote personal sustainability and open their ability to work in future opportunities. If you are not a Veteran or Child, Anomaly can still help you with educational modules and workshops.":{msgstr:["Anomaly ofrece clases y talleres gratuitos sobre varios temas. Ofrecemos estas lecciones a cualquier adulto en necesidad de ayudar a promover la sostenibilidad personal y a ampliar su capacidad pa trabajar en oportunidades futuras. Si usted no es un Veterano o un Niño, Anomaly todavía puede ayudarlo con módulos educativos y talleres."]},"Anomaly provides a wide range of volunteering opportunities in Ukraine. We have divisions in Kyiv, Lviv, Odessa and other Ukrainian cities. The main areas for volunteering are education, ecology, kids assistance, veterans programs, local communities, and animals protection. If you have skills in English teaching, IT, content creation, design, professional training, project management, you are the person we are looking for. If not, but you want to join us, feel free to apply and we will find volunteering opportunities within our team in accordance with your skills and desires. Do you have some ideas of how to improve Ukraine? Bring them to life together with us! Do you need immigration support for living in Ukraine? We provide it for all of our foreign volunteers. Still have questions? Don't hesitate, and fill out our appllication form. Let's talk about your future volunteering journey as a part of the Anomaly team!":{msgstr:["Anomaly ofrece una amplia gama de oportunidades de voluntariado en Ucrania, tenemos divisiones en Kiev, Lviv, Odessa y otras ciudades ucranianas. Las principales áreas de voluntariado son la educación, la ecología, la asistencia a los niños, los programas de veteranos, las comunidades locales y la protección de los animales. Si tienes habilidades en la enseñanza del inglés, TI, creación de contenidos, diseño, formación profesional, gestión de proyectos, eres la persona que estamos buscando. Si no, pero quieres unirte a nosotros siéntase libre de aplicar y encontraremos oportunidades de voluntariado dentro de nuestro equipo de acuerdo con sus habilidades y deseos. ¿Tienes alguna idea de cómo mejorar Ucrania? ¡Tráela a la vida junto con nosotros! ¿Necesita apoyo migratorio para vivir en Ucrania? Lo proporcionamos para todos nuestros voluntarios extranjeros. ¿Todavía tienes preguntas? No te preocupes y llena nuestro formulario de aplicacion. ¡Hablemos de tu futura travesia de voluntario como parte del equipo Anomaly!"]},"Anomaly supports animal shelters in Kyiv, Lviv, and Dnipro. We help volunteers to solve the problem of stray animal overpopulation.":{msgstr:["Anomaly apoya a los protectores de animales en Kiev, Lviv, y Dnipro. Ayudamos a los voluntarios a resolver problemas de sobrepoblacion de animales callejeros."]},"Anomaly works with Kyiv City Administration and local community leaders to help solve everyday problems of Kyiv residents, such as utility outages, road potholes, and piling rubbish.":{msgstr:["Anomaly trabaja con la administración de la ciudad de Kiev y los líderes de la comunidad local para ayudar a resolver los problemas cotidianos de los residentes de Kiev, tales como interrupciones de servicios, mal estado de las calles y basura apilada."]},"Anti - Narc":{msgstr:["Antinarcoticos"]},"Are you or a loved one a veteran who would like to help make Ukraine a better place? If so, join our volunteer team today!":{msgstr:["¿Eres tu o un ser querido un veterano que quisiera ayudar a hacer de Ucrania un lugar mejor? Si es así, ¡únete a nuestro equipo de voluntarios hoy!"]},"Become a Volunteer":{msgstr:["Coviertete en voluntario"]},"Check out our accomplishments":{msgstr:["Echa un vistazo a nuestros logros"]},"Children of ATO Veterans":{msgstr:["Hijos de los Veteranos de ATO"]},"Children of Crimea and Tatars":{msgstr:["Hijos de Crimea y Tatares"]},"Children of Donbas":{msgstr:["Hijos de Donbas"]},"Come grab a drink with us! We offer a cool environment to meet with other veterns like yourself.":{msgstr:["¡Ven a tomar una copa con nosotros! Ofrecemos un ambiente agradable para reunirte con otros veteranos como tu."]},Community:{msgstr:["Comunidad"]},Competency:{msgstr:["Competencia"]},Contacts:{msgstr:["Contactos"]},Creativity:{msgstr:["Creatividad"]},"Crimean Tatars and IDP Children":{msgstr:["Tatares de Crimea y niños IDP"]},"Dare to do the impossible!":{msgstr:["¡Atrévete a hacer lo imposible!"]},"David Plaster":{msgstr:["David Plaster"]},'David\'s favorite way to describe himself is as a "mere pensioner." After retiring from his career as a US Army medic, David came to Ukraine in 2011 and shortly thereafter decided to build a life here. He served with other volunteers as a combat medic both on the Maidan and at the front in Donbas, and he has been working to make Ukraine a better place in every way he can ever since. He founded Anomaly as an organizational vehicle for that vision on Maidan December 1st, 2013 and officially in 2016 as a Ukrainian NGO.':{msgstr:['La forma favorita de David de describirse a sí mismo es como un "mero pensionista". Después de retirarse de su carrera como médico del ejército estadounidense, David vino a Ucrania en 2011 y poco después decidió construir una vida aquí. Sirvió con otros voluntarios como medico de combate tanto en el Maidan como en el frente en Donbas, y ha estado trabajando para hacer de Ucrania un lugar mejor en todas las formas en que pueda luchar. Fundó Anomaly como vehículo organizativo para esa visión el 1 de diciembre de 2013 y oficialmente en 2016 como ONG ucraniana.']},"Developed leadership courses for women where they are typically underrepresented; police, military, science (STEM), led by female professionals in the top of their fields to share expertise and train course attendees in state-of-the-science business methods and career progression skills.":{msgstr:["Cursos de liderazgo desarrollados para las mujeres donde normalmente están subrepresentadas; policía, militar, ciencia (STEM), dirigida por profesionales femeninos de alto nivel en sus campos para compartir conocimientos y capacitar a los participantes en el curso de los métodos científicos y las habilidades de progresión dentro de la carrera."]},"Developing community activism":{msgstr:["Desarrollo de activismo comunitario"]},Diaspora:{msgstr:["Diáspora"]},"Do you have an idea that would help to improve civil society in Ukraine? Let us know!":{msgstr:["¿Tienes una idea que ayudaría a mejorar la sociedad civil en Ucrania? ¡Hásnosla saber!"]},"Do you have something that you want to teach to others? Come join us!":{msgstr:["¿Tienes algo que quieres enseñar a los demás? ¡Únete a nosotros!"]},"Do you want to make Ukraine green again? Join our team and make our home a cleaner, greener place for generations to come!":{msgstr:["¿Quieres volver a hacer verde a Ucrania? ¡Únete a nuestro equipo y haz de nuestro hogar un lugar más limpio y verde para las generaciones venideras!"]},"Don't drink? It's okay - have something non-alcoholic! :) The important thing that we don't drink alone!":{msgstr:["¿No bebes? ¡Está bien! ¡Que bebas algo sin alcohol! :) ¡Lo importante que no bebamos solo!"]},"Drinkin' Bros is an international veterans organization and we run the Ukrainian chapter.":{msgstr:["Drinkin' Bros es una organización internacional de veteranos y nosotros dirigimos el capítulo ucraniano."]},"E - democracy":{msgstr:["E - democracia"]},Ecology:{msgstr:["Ecologia"]},Education:{msgstr:["Educación"]},Email:{msgstr:["Correo electrónico"]},English:{msgstr:["Inglés"]},'Every heard of the saying "it takes a village to raise a child"? It\'s true! Help kids who have family members in the military by joining our mentorship program.':{msgstr:['Cada vez que escuchamos hablar del dicho "se necesita un pueblo para criar a un niño"? ¡Es verdad! Ayuda a los niños que tienen familiares en el ejército uniéndose a nuestro programa de mentores.']},"Everyday Crimean Tartar families are being separated by Russian forces. Imagine losing your father at such a young age. It's all very confusing but mentoring can help!":{msgstr:["Cada día las familias de Tartares de Crimea están siendo separadas por las fuerzas rusas. Imagínese perder a su padre a una edad tan temprana. Es muy confuso pero la mentoría puede ayudar!"]},"Founder & Chairman":{msgstr:["Fundador y Presidente"]},Gallery:{msgstr:["Galería"]},Growth:{msgstr:["Crecimiento"]},"Have experience working with animals or animal rights? Come join us!":{msgstr:["¿Tienes experiencia trabajando con animales o con derechos de animales? ¡Unete a nosotros!"]},"Have experience working with kids? Come show us!":{msgstr:["¿Tienes experiencia trabajando con los niños? ¡Ven a mostrarnos!"]},"Help advocate for animal rights and protect street animals.":{msgstr:["Ayúdenos a defender los derechos de los animales y a proteger a los animales callejeros."]},"Help advocate for better living situtations in orphanges.":{msgstr:["Ayudar a abogar por mejores situaciones de vida en los horfanatos."]},"Help transform how society views stray dogs and help get them homes! Foster a pup today!":{msgstr:["¡Ayuda a transformar cómo la sociedad ve a los perros sin hogar y ayuda a llevarlos a casa! ¡Acoje un cachorro hoy!"]},Home:{msgstr:["Inicio"]},"Housing Authority":{msgstr:["Autoridad de Reunión"]},Integrity:{msgstr:["Integridad"]},"It seems everyday that there's a new narcotics telegram channel graffitied around the neighborhood. We totally get it! To combat this, Anomaly organised local teams to clean up their neighborhoods. Want to know how? Click the box below (can be a highlight of this bot's success compared to the MVS) we work together with our eco team while we are cleaning up the neighborhoods we show people how to reduce drug use in their communities; reference the \"broken window theory\" how cleaner neighborhoods can help to reduce drug use (focus is on the drug issues and community activism development then e democracy meaning showing the locations how to more easily communicate with local admin., city workers, police, and politicians":{msgstr:['Parece que cada día hay un nuevo canal de telegramas de narcóticos grafiados alrededor del vecindario. ¡Lo entendemos totalmente! Para combatir esto, Anomaly organizó equipos locales para limpiar sus vecinos. ¿Quieres saber cómo? Haga clic en el cuadro de abajo (puede ser un punto destacado del éxito de este bot en comparación con el MVS) que trabajamos junto con nuestro equipo ecológico mientras limpiamos los vecinos que mostramos a la gente cómo reducir el consumo de drogas en sus comunidades; hacer referencia a la "teoría de ventanas rotas" cómo vecinos más limpios pueden ayudar a reducir el uso de drogas (centrarse en los problemas de la droga y el desarrollo del activismo comunitario entonces e democracia que significa mostrar los lugares cómo comunicarse más fácilmente con los administradores locales. trabajadores, policías y políticos']},"Join Anomaly Today!":{msgstr:["¡Únete a Anomaly hoy!"]},Kids:{msgstr:["Niños"]},Leadership:{msgstr:["Liderazgo"]},"Leadership courses":{msgstr:["Cursos de liderazgo"]},"LoveUA is a Ukrainian ecology platform made of an association of ecology groups and activists to track and solve eco problems in Ukraine":{msgstr:["LoveUA es una plataforma de ecología ucraniana creada por una asociación de grupos y activistas de la ecología para rastrear y resolver los problemas ecológicos en Ucrania"]},"Military Medicine":{msgstr:["Medicina Militar"]},"Miltary medical training":{msgstr:["Entrenamiento médico militar"]},"Offered courses in SMM, videography, and PR communications to government departments, young business entrepenuers and veterans to help them get their work into the public conversation.":{msgstr:["Cursos ofrecidos en comunicaciones SMM, videografía y relaciones públicas a departamentos gubernamentales, jóvenes empresarios y veteranos para ayudarles a conseguir su trabajo en la medio público."]},Orphans:{msgstr:["Huérfanos"]},"Our founder":{msgstr:["Nuestro fundador"]},"Our projects":{msgstr:["Nuestros proyectos"]},"Our team":{msgstr:["Nuestro equipo"]},Phone:{msgstr:["Teléfono"]},Playgrounds:{msgstr:["Zona de Juegos"]},Social:{msgstr:["Redes Sociales"]},"Social Media Marketing":{msgstr:["Marketing de redes sociales"]},"Social Media Marketing training":{msgstr:["Herramientas de marketing en redes sociales"]},"Social Support":{msgstr:["Soporte social"]},"Support for Ukrainian veterans: Every Sunday we offer free English courses and conversation clubs specifically for veterans, ATO volunteers, and their families in Kyiv.":{msgstr:["Apoyo a veteranos ucranianos: Todos los domingos ofrecemos cursos gratuitos de inglés y clubes de conversación específicamente para veteranos, voluntarios de ATO y sus familias en Kiev."]},"Supported by multiple nations":{msgstr:["Apoyado por múltiples naciones"]},Sustainability:{msgstr:["Sostenibilidad"]},"Today our team includes hundreds of volunteers from more than 12 countries and all over Ukraine. Like billions of drops make an ocean, each of our team members makes their contribution in making Ukraine better.":{msgstr:["Hoy en día, nuestro equipo incluye a cientos de voluntarios de más de 12 países y de toda Ucrania. Al igual que miles de millones de gotas hacen un océano, cada uno de los miembros de nuestro equipo hace su contribución para mejorar Ucrania."]},"Trained over 8000 military, volunteers, and national guardsmen in NATO miltary medical standards. In addition to individual training, Anomaly assisted the National Guard of Ukraine in programmatic development of a NATO-standard medic course, implemented on an organization-wide level.":{msgstr:["Más de 8000 militares entrenados, voluntarios y guardias nacionales en estándares médicos de la OTAN. Además de la capacitación individual, Anomaly ayudó a la Guardia Nacional de Ucrania en el desarrollo programático de un curso de medicina estándar OTAN, implementado a nivel de toda la organización."]},"Ukraine has a large diaspora population which has made homes all over the world, especially in Canada, the United States, and Poland. Since the Revolution of Dignity in 2014, many diaspora have felt called to make a difference.":{msgstr:["Ucrania tiene una gran población diáspora que ha hecho hogares en todo el mundo, especialmente en Canadá, Estados Unidos y Polonia. Desde el Rev. de la Dignidad en 2014, muchas diásporas se han sentido llamadas a marcar la diferencia."]},"Velyka Vasylkivska st, 72, office 20,\nUkraine, 03150, Kyiv":{msgstr:["Velyka Vasylkivska st, 72, oficina 20,\nUcrania, 03150, Kiev"]},"Velyka Vasylkivska st, 72, office 20, Ukraine, 03150, Kyiv":{msgstr:["Velyka Vasylkivska st, 72, oficina 20, Ucrania, 03150, Kiev"]},Veterans:{msgstr:["Veteranos"]},"Volunteering opportunities":{msgstr:["Oportunidades de voluntariado"]},"We also help to connect vets with caretakers, social workers, and psychological support.":{msgstr:["También ayudamos a conectar veterinarios con cuidadores, trabajadores sociales y apoyo psicológico."]},"We are always looking for volunteers to help us solve this problem. If you think that is you, then join us today!.":{msgstr:["Siempre estamos buscando voluntarios que nos ayuden a resolver este problema. Si pienzas que puesdes ser tu, unete a nosotros hoy!."]},"We are the largest group of eco activitists in Ukraine":{msgstr:["Somos el grupo más grande de activistas ecológicos de Ucrania"]},"We conducted more than 55 clean ups in 2019-20":{msgstr:["Realizamos más de 55 limpiezas en 2019 -2020"]},"We have organized a network of 1000+ veteran care specialists from all over the country to help assist veterans with their transition to civilian life and recovery after returning from war.":{msgstr:["Hemos organizado una red de más de 1000 especialistas de cuidados veteranos de todo el país para ayudar a los veteranos en su transición a la vida civil y su recuperación después de regresar de la guerra."]},"We help children of veterans, returned Russian-held political prisoners, Crimean Tatar exiles, and IDPs to attend our free English lessons and speaking clubs.":{msgstr:["Ayudamos a niños de veteranos, retornamos prisioneros políticos recluidos en Rusia, exiliados de Tatar Crimean e identificadores para asistir a nuestras clases gratuitas de inglés y clubes de habla."]},"We make it easy for Kyivans to improve their communities with just their thumbs and an internet connection!":{msgstr:["¡Hacemos fácil para los ciudadanos de Kiev mejorar sus comunidades con sólo sus pulgares y una conexión a Internet!"]},"We organize regular volunteer outings (our tolokas) and social events (Drinkin’ Bros Ukraine) to connect members of the veteran community with each other, their fellow citizens, as well as officials and visitors from local government and embassies.":{msgstr:["Organizamos salidas voluntarias regulares (nuestros tolokas) y eventos sociales (Drinkin’ Bros Ucrania) para conectar a miembros de la comunidad veterana entre sí sus conciudadanos, así como funcionarios y visitantes de las embajadas y gobiernos locales."]},"We organized English-language conversation and craft sessions for younger children of IDPs, ATO veterans, and Crimean Tatars in Kyiv, as well as English conversation clubs for teenaged children of those groups":{msgstr:["Organizamos sesiones de conversación en inglés y artesanía para niños menores de edad, veteranos de ATO y Tatares de Crimea en Kyiv, así como clubes de conversación en inglespara niños adolescentes de esos grupos"]},"We support faster problem solving with local governance by providing reporting tools for the 100,000 residents of the most underserved areas of Kyiv, directly connecting them with local utility service providers.":{msgstr:["Apoyamos la resolución más rápida de problemas con la gobernanza local proporcionando herramientas de información para los 100, 00 residentes de las zonas más marginadas de Kiev, conectándolos directamente con los proveedores locales de servicios públicos."]},"We won first prize in Ukraine and second prize in the world in the 2018 Enactus Award competition":{msgstr:["Ganamos el primer premio en Ucrania y el segundo premio en el mundo en el concurso de Enactus de 2018"]},"We work with the local community policing department to protect the rights of children in Kyiv.":{msgstr:["Trabajamos con el departamento de policía de la comunidad local para proteger los derechos de los niños en Kiev."]},Welcome:{msgstr:["Bienvenidos"]},"What is the Ukrainian Diaspora?":{msgstr:["¿Qué es la diáspora ucraniana?"]},"With our ‘Dbayemo Razom’ project, we connected 1,000+ mental health professionals, 10,000+ trained peer counselors and 3 physical rehabilitation centers. The network shares experience, expertise, and resources to better serve people in Ukraine.":{msgstr:["Con nuestro proyecto “Dbayemo Razom”, conectamos a más de 1.000+ profesionales de salud mental, más de 10.000+ asesores de pares capacitados y 3 centros de rehabilitación física. La red comparte experiencia, experiencia y recursos para servir mejor a la gente en Ucrania."]},"With the war in Eastern Ukraine continuing on, children and families are being separated and forced to leave their homes.":{msgstr:["Con la continuación de la guerra en Ucrania Oriental, los niños y las familias están siendo separados y obligados a abandonar sus hogares."]}}}}}}]);
